import React from "react";

const IMG_API = "https://image.tmbd.org/t/p/original"

const Movie = ({title , poster_path , overview , vote_average}) => (
    <div className="movie">
        <img src={IMG_API + poster_path} alt={title} />
    </div>
);

export default Movie;
